import React, { useEffect, useState } from 'react';
import { useAnalytics } from '../context/AnalyticsContext';
import { useAuth } from '../context/AuthContext';
import Navbar from '../components/common/Navbar';
import './Analytics.css';

const Analytics = () => {
  const { user } = useAuth();
  const { 
    summary, deepfakeDistribution, uploadTimeline, userActivity, verificationStats, pinStats,
    loading, error, fetchSummary, fetchDeepfakeDistribution, fetchUploadTimeline,
    fetchUserActivity, fetchVerificationStats, fetchPinStats
  } = useAnalytics();

  // State for tab management
  const [activeTab, setActiveTab] = useState(0);
  
  // State for filters
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [timeGrouping, setTimeGrouping] = useState('day');

  // Handle tab change
  const handleTabChange = (tabIndex) => {
    setActiveTab(tabIndex);
  };

  // Apply filters
  const applyFilters = () => {
    const filters = {};
    if (startDate) {
      filters.startDate = startDate;
    }
    if (endDate) {
      filters.endDate = endDate;
    }
    
    // Fetch data based on active tab
    if (activeTab === 0) {
      fetchSummary(filters);
    } else if (activeTab === 1) {
      fetchDeepfakeDistribution(filters);
    } else if (activeTab === 2) {
      fetchUploadTimeline(timeGrouping);
    } else if (activeTab === 3 && user.isAdmin) {
      fetchUserActivity();
    } else if (activeTab === 4) {
      fetchVerificationStats();
    } else if (activeTab === 5 && user?.role === 'admin') {
      fetchPinStats(filters);
    }
  };

  // Reset filters
  const resetFilters = () => {
    setStartDate('');
    setEndDate('');
    setTimeGrouping('day');
    
    // Fetch data without filters
    if (activeTab === 0) {
      fetchSummary({});
    } else if (activeTab === 1) {
      fetchDeepfakeDistribution({});
    } else if (activeTab === 2) {
      fetchUploadTimeline('day');
    } else if (activeTab === 3 && user.isAdmin) {
      fetchUserActivity();
    } else if (activeTab === 4) {
      fetchVerificationStats();
    } else if (activeTab === 5 && user?.role === 'admin') {
      fetchPinStats({});
    }
  };

  // Initial data fetch
  useEffect(() => {
    // Fetch data based on active tab
    if (activeTab === 0 && !summary) {
      fetchSummary({});
    } else if (activeTab === 1 && !deepfakeDistribution) {
      fetchDeepfakeDistribution({});
    } else if (activeTab === 2 && !uploadTimeline) {
      fetchUploadTimeline('day');
    } else if (activeTab === 3 && user.isAdmin && !userActivity) {
      fetchUserActivity();
    } else if (activeTab === 4 && !verificationStats) {
      fetchVerificationStats();
    } else if (activeTab === 5 && user?.role === 'admin' && !pinStats) {
      fetchPinStats({});
    }
  }, [activeTab]);

  // Render summary analytics
  const renderSummary = () => {
    if (!summary) return <p>No summary data available</p>;

    return (
      <div className="analytics-section">
        <h3>Summary Statistics</h3>
        <div className="stats-grid">
          <div className="stat-card">
            <h4>Total Images</h4>
            <p className="stat-value">{summary.total_images}</p>
          </div>
          <div className="stat-card">
            <h4>Real Images</h4>
            <p className="stat-value">{summary.real_images}</p>
          </div>
          <div className="stat-card">
            <h4>Fake Images</h4>
            <p className="stat-value">{summary.fake_images}</p>
          </div>
          <div className="stat-card">
            <h4>Verified Images</h4>
            <p className="stat-value">{summary.verified_images}</p>
          </div>
        </div>

        <h3>Real vs Fake Distribution</h3>
        <div className="chart-container">
          <div className="pie-chart-placeholder">
            <p>Real: {summary.real_images} ({Math.round(summary.real_images / (summary.real_images + summary.fake_images) * 100)}%)</p>
            <p>Fake: {summary.fake_images} ({Math.round(summary.fake_images / (summary.real_images + summary.fake_images) * 100)}%)</p>
          </div>
        </div>

        <h3>Confidence Distribution</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Confidence Range</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(summary.confidence_distribution || {}).map(([range, count]) => (
              <tr key={range}>
                <td>{range}</td>
                <td>{count}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Upload Timeline</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Date</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {(summary.upload_timeline || []).map((item, index) => (
              <tr key={index}>
                <td>{item.date}</td>
                <td>{item.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  // Render deepfake distribution
  const renderDeepfakeDistribution = () => {
    if (!deepfakeDistribution) return <p>No deepfake distribution data available</p>;

    return (
      <div className="analytics-section">
        <h3>Deepfake Detection Statistics</h3>
        <div className="stats-grid">
          <div className="stat-card">
            <h4>Total Images</h4>
            <p className="stat-value">{deepfakeDistribution.statistics?.total_images || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Real Avg Confidence</h4>
            <p className="stat-value">{((deepfakeDistribution.statistics?.real_avg_confidence || 0) * 100).toFixed(1)}%</p>
          </div>
          <div className="stat-card">
            <h4>Fake Avg Confidence</h4>
            <p className="stat-value">{((deepfakeDistribution.statistics?.fake_avg_confidence || 0) * 100).toFixed(1)}%</p>
          </div>
        </div>

        <h3>Detailed Confidence Distribution</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Confidence Range</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(deepfakeDistribution.confidence_distribution || {}).map(([range, count]) => (
              <tr key={range}>
                <td>{range}</td>
                <td>{count}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Label Distribution</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Label</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(deepfakeDistribution.label_distribution || {}).map(([label, count]) => (
              <tr key={label}>
                <td>{label}</td>
                <td>{count}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Verification Distribution</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Status</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(deepfakeDistribution.verification_distribution || {}).map(([status, count]) => (
              <tr key={status}>
                <td>{status}</td>
                <td>{count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  // Render upload timeline
  const renderUploadTimeline = () => {
    if (!uploadTimeline) return <p>No upload timeline data available</p>;

    return (
      <div className="analytics-section">
        <h3>Upload Timeline ({uploadTimeline.grouping})</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Period</th>
              <th>Total</th>
              <th>Real</th>
              <th>Fake</th>
            </tr>
          </thead>
          <tbody>
            {(uploadTimeline.timeline || []).map((item, index) => (
              <tr key={index}>
                <td>{item.period}</td>
                <td>{item.count}</td>
                <td>{item.real_count}</td>
                <td>{item.fake_count}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Cumulative Upload Timeline</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Period</th>
              <th>Total</th>
              <th>Real</th>
              <th>Fake</th>
            </tr>
          </thead>
          <tbody>
            {(uploadTimeline.cumulative || []).map((item, index) => (
              <tr key={index}>
                <td>{item.period}</td>
                <td>{item.cumulative_count}</td>
                <td>{item.cumulative_real}</td>
                <td>{item.cumulative_fake}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  // Render user activity (admin only)
  const renderUserActivity = () => {
    if (!user.isAdmin) return <p>Admin access required</p>;
    if (!userActivity) return <p>No user activity data available</p>;

    return (
      <div className="analytics-section">
        <h3>User Statistics</h3>
        <div className="stats-grid">
          <div className="stat-card">
            <h4>Total Users</h4>
            <p className="stat-value">{userActivity.statistics?.total_users || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Active Users</h4>
            <p className="stat-value">{userActivity.statistics?.active_users || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Total Images</h4>
            <p className="stat-value">{userActivity.statistics?.total_images || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Images per User</h4>
            <p className="stat-value">{(userActivity.statistics?.images_per_user || 0).toFixed(1)}</p>
          </div>
        </div>

        <h3>Top Users by Image Count</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Username</th>
              <th>Image Count</th>
              <th>Real</th>
              <th>Fake</th>
              <th>Verified</th>
            </tr>
          </thead>
          <tbody>
            {(userActivity.users || []).slice(0, 10).map((user, index) => (
              <tr key={index}>
                <td>{user.username}</td>
                <td>{user.image_count}</td>
                <td>{user.real_count}</td>
                <td>{user.fake_count}</td>
                <td>{user.verified_count}</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>User Registration Timeline</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Date</th>
              <th>Count</th>
            </tr>
          </thead>
          <tbody>
            {(userActivity.registration_timeline || []).map((item, index) => (
              <tr key={index}>
                <td>{item.date}</td>
                <td>{item.count}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  // Render verification stats
  const renderVerificationStats = () => {
    if (!verificationStats) return <p>No verification stats available</p>;

    return (
      <div className="analytics-section">
        <h3>Verification Statistics</h3>
        <div className="stats-grid">
          <div className="stat-card">
            <h4>Total Images</h4>
            <p className="stat-value">{verificationStats.total_images || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Verified Images</h4>
            <p className="stat-value">{verificationStats.verified_images || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Unverified Images</h4>
            <p className="stat-value">{verificationStats.unverified_images || 0}</p>
          </div>
          <div className="stat-card">
            <h4>Verification Rate</h4>
            <p className="stat-value">{((verificationStats.verification_rate || 0) * 100).toFixed(1)}%</p>
          </div>
        </div>

        <h3>Verification by Label</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Label</th>
              <th>Verified</th>
              <th>Unverified</th>
              <th>Verification Rate</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(verificationStats.by_label || {}).map(([label, data]) => (
              <tr key={label}>
                <td>{label}</td>
                <td>{data.verified}</td>
                <td>{data.unverified}</td>
                <td>{((data.verification_rate || 0) * 100).toFixed(1)}%</td>
              </tr>
            ))}
          </tbody>
        </table>

        <h3>Verification by Confidence</h3>
        <table className="analytics-table">
          <thead>
            <tr>
              <th>Confidence Range</th>
              <th>Verified</th>
              <th>Unverified</th>
            </tr>
          </thead>
          <tbody>
            {Object.entries(verificationStats.by_confidence || {}).map(([range, data]) => (
              <tr key={range}>
                <td>{range}</td>
                <td>{data.verified}</td>
                <td>{data.unverified}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
  };

  return (
    <div>
      <Navbar />
      
      <div className="container">
        <h2>Image Analytics Dashboard</h2>
        
        {/* Filters */}
        <div className="card">
          <h3>Filters</h3>
          <div className="filter-controls">
            <div className="filter-group">
              <label>Start Date:</label>
              <input 
                type="date" 
                value={startDate} 
                onChange={(e) => setStartDate(e.target.value)}
              />
            </div>
            <div className="filter-group">
              <label>End Date:</label>
              <input 
                type="date" 
                value={endDate} 
                onChange={(e) => setEndDate(e.target.value)}
              />
            </div>
            {activeTab === 2 && (
              <div className="filter-group">
                <label>Time Grouping:</label>
                <select 
                  value={timeGrouping} 
                  onChange={(e) => setTimeGrouping(e.target.value)}
                >
                  <option value="day">Day</option>
                  <option value="week">Week</option>
                  <option value="month">Month</option>
                </select>
              </div>
            )}
            <button className="btn" onClick={applyFilters}>Apply Filters</button>
            <button className="btn" onClick={resetFilters}>Reset Filters</button>
          </div>
        </div>
        
        {/* Tabs */}
        <div className="tabs">
          <button 
            className={`tab-button ${activeTab === 0 ? 'active' : ''}`} 
            onClick={() => handleTabChange(0)}
          >
            Summary
          </button>
          <button 
            className={`tab-button ${activeTab === 1 ? 'active' : ''}`} 
            onClick={() => handleTabChange(1)}
          >
            Deepfake Distribution
          </button>
          <button 
            className={`tab-button ${activeTab === 2 ? 'active' : ''}`} 
            onClick={() => handleTabChange(2)}
          >
            Upload Timeline
          </button>
          {user.isAdmin && (
            <button 
              className={`tab-button ${activeTab === 3 ? 'active' : ''}`} 
              onClick={() => handleTabChange(3)}
            >
              User Activity
            </button>
          )}
          <button 
            className={`tab-button ${activeTab === 4 ? 'active' : ''}`} 
            onClick={() => handleTabChange(4)}
          >
            Verification Stats
          </button>
          {user?.role === 'admin' && (
            <button 
              className={`tab-button ${activeTab === 5 ? 'active' : ''}`} 
              onClick={() => handleTabChange(5)}
            >
              IPFS Pin Stats
            </button>
          )}
        </div>
        
        {/* Content */}
        <div className="tab-content">
          {loading ? (
            <div className="spinner"></div>
          ) : error ? (
            <div className="alert alert-danger">{error}</div>
          ) : (
            <>
              {activeTab === 0 && renderSummary()}
              {activeTab === 1 && renderDeepfakeDistribution()}
              {activeTab === 2 && renderUploadTimeline()}
              {activeTab === 3 && renderUserActivity()}
              {activeTab === 4 && renderVerificationStats()}
            </>
          )}
        </div>
      </div>
    </div>
  );
};

export default Analytics;
